/********************************************************************** 
 * 내용설명 : 저장
 * 주요변수 : 
 * 			
 **********************************************************************/ 

 function setHAYZ072C(){

	var sKind		= "getHAYZ072C";						
	var sMethodName = "service::pshumlib/selectHAY011PF.do";     		// 서버에서 호출 될 Method 명
	var sInDataSet  = " ";                      // 자료 저장 시 보낼 DataSet 명칭
	var sOutDataSet = "ds_HAYZ011PF=ds_HAYZ011PF";							// 조회 후 돌려 받을 DataSet 명칭
	var sArgument   = "";
		sArgument += " LIB2=" + quote(Lib2);
		sArgument += " LIB3=" + quote(Lib3);
	http.Sync=true;
	Transaction(sKind, sMethodName, sInDataSet, sOutDataSet, sArgument, "");
	http.Sync=false;

	if(ds_HAYZ011PF.rowcount < 1){
		alert(setPopMessage("2564"));//[확인] 처리할 내역이 없습니다.
		setMessage("2564");
		return;
	}

	st_Msg.Visible = true;
	Div0.Enable = false;
	SetWaitCursor(true);
	SetCapture();

	http.TimeOut = 800;	
	var sKind		= "setHAYZ072C";						
	var sMethodName = "service::pshumlib/saveHAYZ072C.do";     		// 서버에서 호출 될 Method 명
	var sInDataSet  = "";                      // 자료 저장 시 보낼 DataSet 명칭
	var sOutDataSet = "";						// 조회 후 돌려 받을 DataSet 명칭
	var sArgument   = "";
		sArgument += " LIB1=" + quote(Lib1);
		sArgument += " LIB2=" + quote(Lib2);
		sArgument += " LIB3=" + quote(Lib3);
		sArgument += " COMPS=" + quote(Div0.ComboBoxPlant.Value);
	http.Sync=true;
	Transaction(sKind, sMethodName, sInDataSet, sOutDataSet, sArgument, "callback");
	http.Sync=false;
	http.TimeOut = 300;	
}

/********************************************************************** 
 * 내용설명 : Transaction 리턴후 실행 함수
 * 주요변수 : 
 * 			- svcId	Transaction 고유 ID
 * 			- rtnCd 	에러코드
 * 			- rtnMsg 		에러 메세지
 **********************************************************************/ 
function callback(svcId, rtnCd, rtnMsg){
	if(rtnCd<0){
		ReleaseCapture();
		SetWaitCursor(false);
		alert(setPopMessage("5008"));  //[오류] 마감처리는 진행되었으나 마감년월을 관리마스타(MST040PF)에 저장 실패. 
		setMessage("5008");
	}else{
		ReleaseCapture();
		SetWaitCursor(false);
		st_Msg.Visible = false;
		alert(setPopMessage("1001")); //[알림] 정상적으로 처리가 완료되었습니다.
		setMessage("1001");
	}
}

